class App extends React.Component {
    constructor(props){
        super(props)
        this.state={
            users:null,
        }
       // this.updateUser=this.updateUser.bind(this);
    }

   render(){
    return(
        <div>
        <Header />
        <div className="container" style={{marginTop:"66px"}}>
         <CardList />
        </div>
        </div>
       );
   }
}


export default App;
